import Carousel from "../components/Carousel";
import logo from "../components/photo-4.jpeg";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
function Home() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 200,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div className="home-page">
      <div className="container">
        <div className="home-flex">
          <div className="carousel">
            <Slider {...settings}>
              <div className="item">
                <h3>1</h3>
              </div>
              <div className="item">
                <h3>2</h3>
              </div>
              <div className="item">
                <h3>3</h3>
              </div>
            </Slider>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
